import { useSelector } from "react-redux";

const PhotosContent = () => {
  const { list } = useSelector((state) => state.photos);

  return (
    <ul>
      {list.map((photo) => (
        <li key={photo.id}>
          <img src={photo.src} alt={photo.title} />
          <h2>{photo.title}</h2>
          <span>{photo.acessos}</span>
        </li>
      ))}
    </ul>
  );
};

export default PhotosContent;
